	public static class Category {
		public final int category_id; // this is String resource id;
		public final ArrayList< String > emoji_list = new ArrayList<>();
		
		public Category( int category_id ){
			this.category_id = category_id;
		}
	}
	
	public static class EmojiResource {
		@DrawableRes public final int drawableId;
		@Nullable public final String assetsName;
		
		public EmojiResource( @DrawableRes int drawableId ){
			this.drawableId = drawableId;
			this.assetsName = null;
		}
		
		EmojiResource( @NonNull String assetsName ){
			this.drawableId = 0;
			this.assetsName = assetsName;
		}
		
		public boolean isSvg(){
			return assetsName != null;
		}
	}
	
	public static class EmojiInfo {
		@NonNull public final String unified;
		@NonNull public final EmojiResource er;
		
		public EmojiInfo( @NonNull String unified, @NonNull EmojiResource er ){
			this.unified = unified;
			this.er = er;
		}
	}
	
	// 表示に使う。絵文字のユニコードシーケンスから画像リソースIDへのマップ
	public static final HashMap< String, EmojiResource > sUTF16ToEmojiResource = new HashMap<>();
	public static final SparseBooleanArray sUtf16EmojiStartChar = new SparseBooleanArray();

	// 表示と投稿に使う。絵文字のショートコードから画像リソースIDとユニコードシーケンスへのマップ
	public static final HashMap< String, EmojiInfo > sShortNameToEmojiInfo = new HashMap<>();
	
	// 入力補完に使う。絵文字のショートコードのソートされたリスト
	public static final ArrayList< String > sShortNameList = new ArrayList<>();
	
	// ピッカーに使う。カテゴリのリスト
	public static final SparseArray< Category > sCategoryMap = new SparseArray<>();
	
	static{
		initAll();
		Collections.sort( sShortNameList );
		Log.e("SubwayTooter","sUtf16EmojiStartChar size="+sUtf16EmojiStartChar.size());
	}
	
	// 素の数字とcopyright,registered, trademark は絵文字にしない
	private static boolean isIgnored( @NonNull String code ){
		int c = code.charAt( 0 );
		return code.length() == 1 && c <= 0xae || c == 0x2122;
	}
	
	// PNG
//	private static void code( @NonNull String code, @DrawableRes int resId ){
//		if( isIgnored( code ) ) return;
//		sUTF16ToEmojiResource.put( code, new EmojiResource( resId ) );
//		sUtf16EmojiStartChar.put(code.charAt(0),true);
//	}
	
	// Assets
	private static void code( @NonNull String code, @NonNull String assetsName ){
		if( isIgnored( code ) ) return;
		sUTF16ToEmojiResource.put( code, new EmojiResource( assetsName ) );
		sUtf16EmojiStartChar.put(code.charAt(0),true);
	}
	
	private static void name( @NonNull String name, @NonNull String unified ){
		if( isIgnored( unified ) ) return;
		EmojiResource er = sUTF16ToEmojiResource.get( unified );
		if( er == null ) throw new IllegalStateException( "missing emoji for code " + unified );
		sShortNameToEmojiInfo.put( name, new EmojiInfo( unified, er ) );
		sShortNameList.add( name );
	}
	
	private static void category( @StringRes int string_id, @NonNull String name ){
		Category c = sCategoryMap.get( string_id );
		if( c == null ){
			c = new Category( string_id );
			sCategoryMap.put( string_id, c );
		}
		c.emoji_list.add( name );
	}
	
